import React, { Component } from 'react';
import SingleNews from './common/singleNews';
import Counter from './../../../../../counter-app/src/components/counter';

class FiftyFiftyRightList extends Component {
    state = {  }
    render() { 
        const { news } = this.props;
       
        if(!news) return false;
        const check = 1;
        
        return ( 
            
            <React.Fragment>
                <div className="widget-f-flist" >
                
                    { 
                        news.map(eachnews =>
                            (check == 1) ? <SingleNews key={eachnews.id} content={eachnews} /> :''
                        )}
                    
                
                    </div>
            </React.Fragment>
         );
    }
}
 
export default FiftyFiftyRightList;
